import React from 'react';
function Todo({ todo, index, attendence,removeEmployee }) {
  return (
    <div
      className="todo"
      style={{ textDecoration: todo.isAbsent ? "line-through" : "" }}
    >
      {todo.name}
      <span>{todo.employeeId}</span>
      <div>
        <button onClick={() => attendence(index)}>Absent</button>
        <button onClick={() => removeEmployee(index)}>Remove</button>
      </div>
    </div>
  );
};

export default Todo;
